Su banko „Luminor“ programėle išmaniajam telefonui kasdienės paslaugos privatiems ir verslo klientams yra pasiekiamos 24 valandas per parą.

Turėdami banko „Luminor“ programėlę išmaniajame telefone, galėsite:
- sužinoti sąskaitų ir kortelių likutį;
- peržiūrėti paskutinių transakcijų informaciją;
- atlikti visų tipų mokėjimus;
- papildyti savo kreditinės kortelės sąskaitą;
- peržiūrėti  savo indėlius;
- peržiūrėti paskolų ir lizingo informaciją;
- rasti artimiausią banko poskyrį ir bankomatą;
- pasinaudoti valiutų skaičiuokle;
- apskaičiuoti paskolos mėnesio įmoką;
- susidaryti taupymo grafiką;
- peržiūrėti kainyną;
- pakeisti programėlės kalbą;
- susisiekti su banko „Luminor“ informacijos centru (telefonu, paštu arba „Skype“);
- užsisakyti pranešimų paslaugą;
- patikrinkite ir apmokėkite savo e-sąskaitas.


Prie banko „Luminor“ mobiliosios bankininkystės Jūs galite prisijungti, naudodami tas pačias priemones kaip ir kompiuteriu jungdamiesi prie internetinės bankininkystės sistemos: 
- savo pačių sukurtą slaptažodį (Light Login);
- Nordea Codes programėlę
- kodų generatorių
- mobilųjį parašą.

